INSERT INTO `notice` VALUES ('7', '6', '武汉市道路交通安全问题', '', '', '', '0', '', '（1）驾驶与准驾车型不符的机动车的；<br />\r\n（2）饮酒后驾驶机动车的；<br />\r\n（3）驾驶营运客车（不包括公共汽车）、校车载人超过核定人数20％以上的；<br />\r\n（4）造成交通事故后逃逸，尚不构成犯罪的；<br />\r\n（5）上道路行驶的机动车未悬挂机动车号牌的，或者故意遮挡、污损、不按规定安装机动车号牌的；<br />\r\n（6）使用伪造、变造的机动车号牌、行驶证、驾驶证、校车标牌或者使用其他机动车号牌、行驶证的；<br />\r\n（7）驾驶机动车在高速公路上倒车、逆行、穿越中央分隔带调头的；<br />\r\n（8）驾驶营运客车在高速公路车道内停车的；<br />\r\n（9）驾驶中型以上载客载货汽车、校车、危险物品运输车辆在高速公路、城市快速路上行驶超过规定时速20％以上或者在高速公路、城市快速路以外的道路上行驶超过规定时速50％以上，以及驾驶其他机动车行驶超过规定时速50%以上的；<br />\r\n（10）连续驾驶中型以上载客汽车、危险物品运输车辆超过4小时未停车休息或者停车休息时间少于20分钟的；<br />\r\n（11）未取得校车驾驶资格驾驶校车的。<img src=\"/upload_newsimage/20160408/20160408155541_229.jpg\" alt=\"\" />', '1', '001001', '2016-10-20 16:19:45', '1', '1001');
