INSERT INTO `step3` VALUES ('59', '128', null, '中城时代五期1#3#5#7#公租房装修工程。', '工作目标：依据合同，相关法律法规及文件、实测报告书、竣工图纸、会议纪要、设计变更和现场签证等所有与工程造价相关资料确定该工程最终造价。\r\n工作范围：对该项目合同及图纸范围内的装饰、安装工程进行结算审核和财务审核。', null, '1、2017年09月14日对资料进行熟悉并提交缺件通知单；\r\n2、2017年09月18日进行现场勘查；\r\n3、2017年09月28日以前完成初步审核工作并自检；\r\n4、2017年09月28日下午5点前将初审文件发送至二审进行审核；\r\n5、2017年09月29日上午10点前将编制成果发送至三审进行核；\r\n6、2017年09月29日下午根据三审意见对编制成果进行修改并完善并于当日下午5点前将征求意见稿电子版发送至甲方；\r\n7、2017年09月30日根据甲方要求对成果网文件进行调整并打印报告。', '', '刘安安', '王雁然', '001001', '2017-10-09 10:21:05', '119', '2017-09-29 15:59:52', '1', '结算书、图纸、合同、相关法律法规、相关定额等。');
