INSERT INTO `step3` VALUES ('61', '130', null, '南水北调中线一期汉江中下游部分闸站改造工程天门闸站改造土建及金结、电气设备安装与安装工程（以下简称本工程）位于天门市内。包含5个单位工程，刘家河泵站位于汉江左岸桩号14+750m处；杨家月泵站位于汉江左岸桩号156+300m处；彭麻闸站位于汉江左岸桩号162+050m处；彭市泵站及彭市闸站位于汉江左岸桩号172+700m处。本工程主要建设内容：新建刘家河泵站从外江到内湖分别由引渠及进水池、主机段、输水管道、出水池等组成。刘家河泵站工程主要建筑物为4级；新建杨家月泵站进水池、主泵室、输水管道及出水池等组成，主泵室主要由泵室墩墙、出水阀室等组成。杨家月泵站工程主要建筑物为4级；新建彭麻闸站由左、右侧泵室及高闸等组成，主泵室主要由U型槽、主泵室、出水池及出水压力箱涵组成。彭麻闸站工程主要建筑物为4级；新建彭市泵站由上游侧单座泵室组成，主泵室主要由进水池段、主泵室、出水池及出水压力箱涵组成。彭市泵站工程主要建筑物为4级；新建彭市闸上下游联接、闸室及工作桥、1-4节箱涵段组成，彭市闸工程主要建筑物为2级。', '南水北调中线一期汉江中下游部分闸站改造工程天门闸站改造土建及金结、电气设备安装与安装工程（以下简称本工程）位于天门市内。包含5个单位工程，刘家河泵站位于汉江左岸桩号14+750m处；杨家月泵站位于汉江左岸桩号156+300m处；彭麻闸站位于汉江左岸桩号162+050m处；彭市泵站及彭市闸站位于汉江左岸桩号172+700m处。本工程主要建设内容：新建刘家河泵站从外江到内湖分别由引渠及进水池、主机段、输水管道、出水池等组成。刘家河泵站工程主要建筑物为4级；新建杨家月泵站进水池、主泵室、输水管道及出水池等组成，主泵室主要由泵室墩墙、出水阀室等组成。杨家月泵站工程主要建筑物为4级；新建彭麻闸站由左、右侧泵室及高闸等组成，主泵室主要由U型槽、主泵室、出水池及出水压力箱涵组成。彭麻闸站工程主要建筑物为4级；新建彭市泵站由上游侧单座泵室组成，主泵室主要由进水池段、主泵室、出水池及出水压力箱涵组成。彭市泵站工程主要建筑物为4级；新建彭市闸上下游联接、闸室及工作桥、1-4节箱涵段组成，彭市闸工程主要建筑物为2级。', null, '1、2017年9月21日收到甲方提供的资料并熟悉资料；\r\n2、2017年9月22日提交缺件通知单；\r\n3、2017年9月23日上午去看了现场；\r\n4、2017年9月23日下回公司拿资料；\r\n5、2017年9月24日初步审核；\r\n5、2017年9月25日将初审结果发给二审；\r\n6、2017年9月26日修改二审提出的意见；\r\n7、2017年9月27提交到三审进行复核，复核完将征求意见稿发给业主确认；\r\n8、2017年9月28日根据甲方要求出具正式报告，打印盖章；\r\n9、项目归档，项目完结\r\n10、22\r\n11、\r\n11、2', '同意！\r\n好吧\r\n', null, null, '001001', null, '1', '2017-10-11 14:56:00', '1', null);
